import React from "react";
import UserAccount from "../../Img/user-account.png"
import BtnUser from "../BtnUser/BtnUser";
/*import "./Eliminar.css";*/

const Navbar = function() {

    return(
    <div className="Nav">
        <div>
            <img/>
        </div>
        <div>
            <BtnUser ImgUs={UserAccount}></BtnUser>
        </div>
    </div>
    );
}

export default Navbar;
